import styled from 'styled-components';

export const Body= styled.div`
    font-family: sans-serif;
    text-align: center;
    background: #0e101c;
    color: white;
    padding: 0 20px 50px;
`;

export const Form= styled.div`
    max-width: 800px;
    margin: 0 auto;
`;

export const P= styled.p`
    color: #bf1650;
    text-align: center;
`;
